import React, { useState } from "react";
import { makeStyles } from "@material-ui/core/styles";
import List from "@material-ui/core/List";
import ListItem from "@material-ui/core/ListItem";
import ListItemAvatar from "@material-ui/core/ListItemAvatar";
import ListItemSecondaryAction from "@material-ui/core/ListItemSecondaryAction";
import ListItemText from "@material-ui/core/ListItemText";
import Avatar from "@material-ui/core/Avatar";
import IconButton from "@material-ui/core/IconButton";
import DeleteIcon from "@material-ui/icons/Delete";
import PersonIcon from "@material-ui/icons/Person";
import Grid from "@material-ui/core/Grid";
import { Typography } from "@material-ui/core";
import { Paper } from "@material-ui/core";

const useStyles = makeStyles((theme) => ({
  root: {
    maxWidth: 752,
  },
  demo: {
    backgroundColor: theme.palette.background.paper,
  },
  title: {
    margin: theme.spacing(4, 5, 2),
  },
  searchbar: {
    "& > *": {
      margin: theme.spacing(1),
      width: "25ch",
    },
  },
  button: {
    margin: theme.spacing(2),
  },
  formControl: {
    margin: theme.spacing(1),
    minWidth: 120,
  },
}));

function generate(element) {
  return [0, 1, 2].map((value) =>
    React.cloneElement(element, {
      key: value,
    })
  );
}

const entryMatchesQueries = (props, value) => {
  let nameDidMatch = false;
  let lastName = value.name.substring(value.name.indexOf(" ") + 1);

  if (props.nameQuery !== "") {
    if (lastName.toLowerCase().includes(props.nameQuery.toLowerCase())) {
      // both queries must be fulfilled before returning true
      if (props.cityQuery === "") return true;
      nameDidMatch = true;
    }
  }

  if (props.cityQuery !== "") {
    if (
      value.address.city.toLowerCase().includes(props.cityQuery.toLowerCase())
    ) {
      if (props.nameQuery === "" || nameDidMatch === true) return true;
    }
  }

  return false;
};

export default function SearchItems(props) {
  const classes = useStyles();
  const [dense, setDense] = useState(false);

  const handleDelete = (id) => {
    let newList = [];
    props.displayList.forEach((element) => {
      if (element.id !== id) {
        newList.push(element);
      }
    });

    props.updateDisplayList(newList);
  };

  return (
    <>
      <Paper
        variant="outlined"
        style={{
          marginTop: "1rem",
        }}
      >
        <Grid container spacing={3} style={{ marginLeft: 10, flex: 1 }}>
          <Grid item>
            <Typography variant="overline" fontWeight="bold">
              name/city
            </Typography>
          </Grid>
          <Grid item style={{ flex: 0.36 }}>
            <Typography variant="overline" fontWeight="bold">
              email
            </Typography>
          </Grid>
          <Grid item style={{ flex: 0.23 }}>
            <Typography variant="overline" fontWeight="bold">
              phone number
            </Typography>
          </Grid>
        </Grid>
      </Paper>

      <List dense={dense}>
        {props.displayList.map((value) => {
          if (
            (props.nameQuery === "" && props.cityQuery === "") ||
            entryMatchesQueries(props, value)
          ) {
            return (
              // fixes `each child in an array or iterator should have a unique “key” prop` error
              <ListItem key={value.id} style={{ flex: 1 }}>
                <ListItemAvatar style={{ flex: 0.02 }}>
                  <Avatar>
                    <PersonIcon />
                  </Avatar>
                </ListItemAvatar>
                <ListItemText
                  style={{ flex: 0.2 }}
                  primary={value.name}
                  secondary={value.address.city}
                />
                <Grid container style={{ flex: 0.7 }}>
                  <Grid item style={{ flex: 0.4 }}>
                    {value.email}
                  </Grid>
                  <Grid item style={{ flex: 0.4 }}>
                    {value.phone}
                  </Grid>
                </Grid>
                <ListItemSecondaryAction>
                  <IconButton
                    edge="end"
                    aria-label="delete"
                    onClick={() => {
                      handleDelete(value.id);
                    }}
                  >
                    <DeleteIcon />
                  </IconButton>
                </ListItemSecondaryAction>
              </ListItem>
            );
          }
        })}
      </List>
    </>
  );
}
